geregisseerd door Daric Gates
met Will Wallace, Dean Cain en Don Swayze

Rechercheur Michael verhuist vanuit de grote stad naar een leuk klein plaatsje met zijn vrouw Rachel, nadat ze emotioneel ingestort zijn door de plotselinge dood van hun dochter. Michael neemt een baan op het kantoor van de sheriff, denkende dat er niet veel zal gebeuren in het rustige dorpje. Echter, op zijn eerste dag wordt Michael gevraagd om samen met sheriff Hendricks de mysterieuze verdwijning van een tienermeisje te onderzoeken. Ze blijkt opgesloten te zijn in een psychiatrische inrichting. Wanneer ze haar arts ontmoeten blijkt, tot ongeloof van Michael, het meisje om te kunnen gaan met een duistere, bovennatuurlijke entiteit.


